	@Mock
	private Pet mockPet;

	@InjectMocks
	private VisitController controller;

	@Test
	@DisplayName("setAllowedFields with valid WebDataBinder")
	void setAllowedFieldsWithValidDataBinder() {
		WebDataBinder dataBinder = new WebDataBinder(this);

		assertThatNoException().isThrownBy(() -> controller.setAllowedFields(dataBinder));
	}

	@Test
	@DisplayName("setAllowedFields with null WebDataBinder - edge case")
	void setAllowedFieldsWithNullDataBinder() {
		WebDataBinder dataBinder = null;

		// Assuming it may throw NullPointerException in edge case
		assertThatThrownBy(() -> controller.setAllowedFields(dataBinder)).isInstanceOf(NullPointerException.class);
	}

	@Test
	@DisplayName("loadPetWithVisit with valid owner and pet - happy path")
	void loadPetWithVisitWithValidOwnerAndPet() {
		int ownerId = 1;
		int petId = 1;
		Map<String, Object> model = new HashMap<>();

		when(owners.findById(ownerId)).thenReturn(Optional.of(owner));
		when(owner.getPet(petId)).thenReturn(mockPet);

		Visit visit = controller.loadPetWithVisit(ownerId, petId, model);

		assertThat(visit).isNotNull();
	}

	@Test
	@DisplayName("loadPetWithVisit with owner not found - edge case")
	void loadPetWithVisitWithOwnerNotFound() {
		int ownerId = 999;
		int petId = 1;
		Map<String, Object> model = new HashMap<>();

		when(owners.findById(ownerId)).thenReturn(Optional.empty());

		// Assuming it throws an exception when owner not found
		assertThatThrownBy(() -> controller.loadPetWithVisit(ownerId, petId, model))
			.isInstanceOf(RuntimeException.class);
	}

}
